import React, { useEffect, useState } from "react";
import { parse } from "qs";

const App = () => {
  useEffect(() => {
    const target = document.querySelector("#target");
    console.log(target);
    const string1 = [1, 4, 6, 2, 6];
    let numberOne = string1[0]
    console.log(numberOne);

    const myName = () => {
      string1.push(3000);
      target.textContent += string1;
    };
    myName();
    const loop = () => {
      setTimeout(() => {
        myName();
        loop();
      }, 500);
    };
    loop();
  });

  return (
    <>
      <h1 className="mt-5 mx-auto text-center d-flex justify-content-center">
        Je suis <span id="target"> </span>
      </h1>
    </>
  );
};

export default App;
